void generate_polynomial_features(double X0, double Y0, double Z0, double* output) {
    output[0] = 1;
    output[1] = X0;
    output[2] = Y0;
    output[3] = Z0;
    output[4] = X0 * X0;
    output[5] = X0 * Y0;
    output[6] = X0 * Z0;
    output[7] = Y0 * Y0;
    output[8] = Y0 * Z0;
    output[9] = Z0 * Z0;
    output[10] = X0 * X0 * X0;
    output[11] = X0 * X0 * Y0;
    output[12] = X0 * X0 * Z0;
    output[13] = X0 * Y0 * Y0;
    output[14] = X0 * Y0 * Z0;
    output[15] = X0 * Z0 * Z0;
    output[16] = Y0 * Y0 * Y0;
    output[17] = Y0 * Y0 * Z0;
    output[18] = Y0 * Z0 * Z0;
    output[19] = Z0 * Z0 * Z0;
}

void apply_model(double** coefs, double* features, double* output) {
    for (int i = 0; i < 3; i++) {
        output[i] = 0;
        for (int j = 0; j < 20; j++) {
            output[i] += coefs[i][j] * features[j];
        }
    }
}
